import './calendar.css';
import React from 'react';
import logo from "./IMG/Logo.jpg"
import userLogo from "./IMG/userLogo.png"



function Calendar() {

    let container = document.querySelector(".container");

    dycalendar.draw({
       target:'#dycalendar', 
       dayformat: 'full', 
       type: 'month', 
       monthformat: 'full', 
       highlighttoday: true, 
    });  


    return(
        <>
            <div class="container">

                <div class="dycalendar" id="dycalendar"></div> 

            </div>  
        </>

    )
}





export default Calendar;
